import React from "react";
import "./Frame3618.css";

function Frame3618(props) {
  const { text6, text7, className } = props;

  return (
    <div className={`frame-3618 ${className || ""}`}>
      <div className="text-6 ibmplexsans-normal-quarter-spanish-white-16px">{text6}</div>
      <div className="text-7 ibmplexsans-normal-quarter-spanish-white-16px">{text7}</div>
    </div>
  );
}

export default Frame3618;
